import React, { Component } from 'react'
import { style_mapping } from "../../styled";

import HeaderBanner from '../components/shared/HeaderBanner'
import ProfileHeader from '../components/areas/Profile/profile-header'
import ProfileContent from '../components/areas/Profile/profile-content'

const {
    layout: { ContentArea },
    profile: { ProfileHeaderContainer, ProfilePicture, ProfileResume, ProfileHeaderTop, ProfileHeaderBottom, ProfileLinks, ProfileName, ProfileCommands }
} = style_mapping;

class Profile extends Component {
  render() {
    return (
      <>
        <Header>
          <HeaderBanner />
          <ProfileHeader />
        </Header>
        <ProfileContent />
      </>
    )
  }
}

export default Profile
